import React  from 'react';
import './App.css';
import Nav from './Componentes/Nav/Nav.jsx'
import Header  from './Componentes/Header/Header';
import ItemListContainer from './Componentes/ItemListContainer/ItemListContainer';
import Footer from './Componentes/Footer/Footer';
import CartWidget from './Componentes/CartWidget/CartWidget'
import { BrowserRouter, Route, Switch } from 'react-router-dom';


function App() {


  return (
    <> 
      <BrowserRouter> 
        <Nav className='Nav'/>      
        <Header titulo='Muy Pronto' subtitulo='algo muy copado esta viniendo..' className='Header'/>
        <Switch>
        <Route path='/productos' component={Nav} />
        <Route path='/cart' component={CartWidget} />
        <Route path='/index' component={Nav} />
        </Switch>




        <ItemListContainer greeting='Lo mas vendido' className='Container'/>
        <Footer className='Footer'/>
        </BrowserRouter>
    </>
  );
}

export default App;
